import React, { useEffect, useState, useContext } from "react";
import DBCard from "../../components/ui/DBCard";
import AutoCarousel from "../../components/ui/AutoCarousel";
import useAuthCheck from "../../hooks/useAuthCheck";
import { ThemeContext } from "../../context/Theme";
import DonutChart from "../../components/ui/DonutChart";
import LineChart from "../../components/ui/LineChart";
const serverUrl = process.env.REACT_APP_SERVER_URL;

function AdminDashboard() {
  useAuthCheck();
  const [theme, setTheme] = useContext(ThemeContext);

  const images = [
    "https://img.daisyui.com/images/stock/photo-1559703248-dcaaec9fab78.webp",
    "https://img.daisyui.com/images/stock/photo-1565098772267-60af42b81ef2.webp",
    "https://img.daisyui.com/images/stock/photo-1572635148818-ef6fd45eb394.webp",
    "https://img.daisyui.com/images/stock/photo-1494253109108-2e30c049369b.webp",
    "https://img.daisyui.com/images/stock/photo-1550258987-190a2d41a8ba.webp",
    "https://img.daisyui.com/images/stock/photo-1559181567-c3190ca9959b.webp",
    "https://img.daisyui.com/images/stock/photo-1601004890684-d8cbf643f5f2.webp",
  ];
  const characters = [
    "https://img.daisyui.com/images/stock/photo-1559703248-dcaaec9fab78.webp",
    "https://img.daisyui.com/images/stock/photo-1565098772267-60af42b81ef2.webp",
    "https://img.daisyui.com/images/stock/photo-1572635148818-ef6fd45eb394.webp",
    "https://img.daisyui.com/images/stock/photo-1494253109108-2e30c049369b.webp",
    "https://img.daisyui.com/images/stock/photo-1550258987-190a2d41a8ba.webp",
    "https://img.daisyui.com/images/stock/photo-1559181567-c3190ca9959b.webp",
    "https://img.daisyui.com/images/stock/photo-1601004890684-d8cbf643f5f2.webp",
  ];

  return (
    <div className="w-full h-full flex flex-col flex-grow gap-5">
      <div
        className={`flex w-full text-md rounded-xl h-16 shadow-md  p-4 pl-10 font-bold bg-${theme}`}
      >
        DASHBOARD
      </div>
      <div className=" flex flex-wrap justify-center gap-x-5 gap-y-10 ">
        <DBCard
          theme={theme}
          title={"Player"}
          number={40}
          icon={<i className="fa-solid fa-users"></i>}
        />
        <DBCard
          theme={theme}
          title={"Admin"}
          number={40}
          icon={<i class="fa-solid fa-user-tie"></i>}
        />
        <DBCard
          theme={theme}
          title={"Item"}
          number={2}
          icon={<i class="fa-solid fa-hat-wizard"></i>}
        />
        <DBCard
          theme={theme}
          title={"Offer"}
          number={5}
          icon={<i class="fa-solid fa-sack-dollar"></i>}
        />

        <div
          className={`place-content-center  rounded-xl p-5 shadow-md flex flex-wrap flex-2 flex-col gap-5 w-full max-w-lg max-h-64 bg-${theme}`}
        >
          <LineChart />
        </div>
        <div
          className={`rounded-xl p-5 shadow-md flex flex-2 flex-col gap-5 w-full max-w-md xl:max-w-lg  bg-${theme}`}
        >
          <p className="text-sm font-bold">Recent Transactions</p>
          <div className="overflow-auto">
            <table className="table table-zebra">
              {/* head */}
              <thead>
                <tr>
                  <th></th>
                  <th>Username</th>
                  <th>Offer</th>
                  <th>Price</th>
                  <th>Date</th>
                </tr>
              </thead>
              <tbody>
                {/* row 1 */}
                <tr>
                  <th>1</th>
                  <td>Rori</td>
                  <td>Bundle</td>
                  <td>200</td>
                  <td>10-6-2024</td>
                </tr>
                {/* row 2 */}

                <tr>
                  <th>2</th>
                  <td>Siopai</td>
                  <td>Vault</td>
                  <td>300</td>
                  <td>10-6-2024</td>
                </tr>
                {/* row 3 */}
                <tr>
                  <th>3</th>
                  <td>SMOOSH3R</td>
                  <td>Sack</td>
                  <td>100</td>
                  <td>10-6-2024</td>
                </tr>
              </tbody>
            </table>
          </div>
        </div>
        <div
          className={`rounded-xl p-5 shadow-md flex flex-2 flex-col gap-5 w-full max-w-screen-lg  bg-${theme}`}
        >
          <p className="text-sm font-bold">Recent Registration</p>
          <div className="overflow-x-auto">
            <table className="table table-zebra">
              {/* head */}
              <thead>
                <tr>
                  <th></th>
                  <th>Username</th>
                  <th>Email</th>
                  <th>Type</th>
                  <th>Date</th>
                </tr>
              </thead>
              <tbody>
                {/* row 1 */}
                <tr>
                  <th>1</th>
                  <td>Rori</td>
                  <td>rori@gmail.com</td>
                  <td>P</td>
                  <td>10-6-2024</td>
                </tr>
                {/* row 2 */}

                <tr>
                  <th>2</th>
                  <td>Siopai</td>
                  <td>siopai@gmail.com</td>
                  <td>P</td>
                  <td>10-6-2024</td>
                </tr>
                {/* row 3 */}
                <tr>
                  <th>3</th>
                  <td>SMOOSH3R</td>
                  <td>smoosh3r@gmail.com</td>
                  <td>P</td>
                  <td>10-6-2024</td>
                </tr>
              </tbody>
            </table>
          </div>
        </div>
      </div>
      {/* <DBCard /> <DBCard /> <DBCard /> <DBCard /> */}
    </div>
  );
}

export default AdminDashboard;
